import React from 'react';
import ReactDOM from 'react-dom';

import '../css/App.css';

export default function Navegation(props){
    const loggin = props.loggin;
    if (loggin){
        return(
            <div> Inrego Logeado {loggin} </div>
        )
    }
    return(
        <div> Ingreso Deslogeado {loggin}</div>
    )

}    

const element = <Navegation loggin='false' />;
ReactDOM.render(
  element,
  document.getElementById('root')
)
